import React, { Component } from 'react';
// import SearchBar from "../utils/SearchBar";
import ProjectDetailsModal from './ProjectDetailsModal';
import Form from 'react-bootstrap/Form';
import Stack from 'react-bootstrap/Stack';
import Col from 'react-bootstrap/Col';
import InputGroup from 'react-bootstrap/InputGroup';

class Projects2 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      deps: {},
      detailsModalShow: false,
      filteredProjects: [],
      searchInput: '',
      value: 'All'
    };
  }

  filterProjects = (query) => {
    const filtered = this.props.resumeProjects.filter((project) =>
      project.title.toLowerCase().includes(query.toLowerCase())

    );
    this.setState({ filteredProjects: filtered });

  };

  handleChange = (e) => {
    this.setState({ searchInput: e.target.value });
  };

  handleSelectChange = (e) => {
    this.setState({ value: e.target.value });
  };

  render() {
    let detailsModalShow = (data) => {
      this.setState({ detailsModalShow: true, deps: data });
    };

    let detailsModalClose = () => this.setState({ detailsModalShow: false });

    let projects = [];

    if (this.props.resumeProjects && this.props.resumeBasicInfo) {
      var sectionName = this.props.resumeBasicInfo.section_name.projects2;
      projects = this.state.filteredProjects.length
        ? this.state.filteredProjects
        : this.props.resumeProjects;

      projects = projects.map(function (project) {
        return (
          <div
            className="col-sm-12 col-md-6 col-lg-4"
            key={project.title} // <-- use project.title instead of projects.title
            style={{ cursor: "pointer" }}
          >
            <span className="portfolio-item d-block">
              <div className="foto" onClick={() => detailsModalShow(project)}>
                <div>
                  <img
                    src={project.images[0]}
                    alt="projectImages"
                    height="230"
                    width="368"
                    style={{ marginBottom: 0, paddingBottom: 0, position: 'relative' }}
                  />
                  <span className="project-date">{project.startDate}</span>
                  <br />
                  <p className="project-title-settings mt-3">
                    {project.title}
                  </p>
                </div>
              </div>
            </span>
          </div>
        );
      });
    }
    const allProjects = this.props.resumeProjects;
    const { searchInput } = this.state;
    const filteredProjects = allProjects.filter(project =>
      (searchInput === '' || project.title.toLowerCase().includes(searchInput.toLowerCase())) &&
      (this.state.value === 'All' || project.startDate === parseInt(this.state.value))
    );

    return (
      <div>
        {/* <SearchBar filterProjects={this.filterProjects} resumeProjects={projects} /> */}
        <React.Fragment>
          <Stack>

          </Stack>
          <div className="project-choices">
            {filteredProjects.map((project) => (
              <Col>
                <Projects2 resumeProjects={[project]} />
              </Col>
            ))}
          </div>
          <Stack>
            <InputGroup>
              <Form.Control
                type="search"
                onChange={this.handleChange}
                placeholder="Search"
                aria-label="Search"
                aria-describedby="basic-addon1"
                value={searchInput}
              />
              <InputGroup.Text id="basic-addon1">Filter by:</InputGroup.Text>
              <Form.Control as="select" onChange={this.handleSelectChange} value={this.state.value}>
                <option value="All">All</option>
                <option value="name">Name</option>
                <option value="popularity">Popularity</option>
                <option value="recent">Recent</option>
                <option value="size">Size</option>
              </Form.Control>
            </InputGroup>
          </Stack>
        </React.Fragment>
        <div className="background">
          <div className="transparentbox">
            <section id="portfolio">
              <div className="col-md-12">
                <h1 className="section-title" style={{ color: "black" }}>
                  <span>{sectionName}</span>
                </h1>
                <div className="col-md-12 mx-auto">
                  <div className="row mx-auto">{projects}</div>
                </div>
                <ProjectDetailsModal
                  show={this.state.detailsModalShow}
                  onHide={detailsModalClose}
                  data={this.state.deps}
                />
              </div>
            </section>
          </div>
        </div>
      </div>
    );
  }
}

export default Projects2;
